To perform division in complex numbers, we multiply both the numerator and the denominator by the conjugate of the denominator. In this case, the conjugate of $1+2i$ is $1-2i$. Multiplying: \begin{align*}
\frac{-3+4i}{1+2i}&=\frac{(-3+4i)(1-2i)}{(1+2i)(1-2i)}\\
&=\frac{-3+4i+6i-8i^2}{1+2i-2i-4i^2}\\
&=\frac{5+10i}{5}\\
&=\boxed{1+2i}
\end{align*}

Let $j$ be John's age and $d$ be his dad's age. We are trying to find the value of $d$. We can create a system of two equations to represent the given information. They are

\begin{align*}
j &= d - 31 \\
j + d &= 53 \\
\end{align*}

We want to find $d$, so we need to eliminate $j$ from the equations above. Substituting the first equation into the second to eliminate $j$, we have $(d-31)+d=53$, or $d=42$. Thus, John's dad is $\boxed{42}$ years old.

If $x^2 + kx + 15= (x+a)(x+b)$, then \[x^2 + kx + 15 = x^2 + ax +bx +ab = x^2 +(a+b)x + ab.\]Therefore, we must have $ab = 15$, and for any such $a$ and $b$, we have $k = a+b$.   There are four pairs of integers that multiply to 15.  They are 1 and 15 (which give $k=16$), 3 and 5 (which give $k=8$), $-1$ and $-15$ (which gives $k=-16$), and -3 and -5 (which give $k=-8$).  The product of these four possible values of $k$ is \begin{align*}
(16)(8)(-16)(-8)& = (2^4)(2^3)(-2^4)(-2^3)\\
& = 2^{4+3+4+3} \\&= 2^{14}\\& = 2^{10}\cdot 2^4 = (1024)(16) = \boxed{16384}.
\end{align*}

